      margin-bottom: 15px;
    }

    .story-item p {
      color: #6b7280;
      line-height: 1.6;
    }

    .values-grid {
      display: grid;
      grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
      gap: 30px;
    }

    .value-card {
