      padding: 30px;
      border-radius: 12px;
      box-shadow: 0 4px 20px rgba(0, 0, 0, 0.1);
      text-align: center;
    }

    .value-card h3 {
      font-size: 1.25rem;
      font-weight: 600;
      color: #2563eb;
      margin-bottom: 15px;
    }

    .value-card p {
      color: #6b7280;
      line-height: 1.6;
    }

    .interests-grid {
      display: grid;
      grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
      gap: 30px;
    }

    .interest-item {
      background: white;
      padding: 30px;
      border-radius: 12px;
      box-shadow: 0 4px 20px rgba(0, 0, 0, 0.1);
      text-align: center;
    }

    .interest-icon {
      font-size: 2.5rem;
      margin-bottom: 15px;
    }

    .interest-item h3 {
      font-size: 1.25rem;
      font-weight: 600;
      color: #1f2937;
      margin-bottom: 15px;
    }

    .interest-item p {
      color: #6b7280;
      line-height: 1.6;
    }

    .cta-section {
      padding: 80px 0;
      background: #1f2937;
      color: white;
      text-align: center;
    }

    .cta-content h2 {
      font-size: 2.5rem;
      font-weight: 700;
      margin-bottom: 20px;
    }

    .cta-content p {
      font-size: 1.25rem;
      margin-bottom: 40px;
      opacity: 0.9;
